import React, { useEffect, useState, version } from 'react'
import axios from 'axios'
import { Button } from 'primereact/button';

const Test = () => {
    const [api, setApi] = useState([]);

    useEffect(() => {
        axios
            .get("http://localhost:3300/test")
            .then((res) => {
                setApi(res.data)
                // console.log(res.data)
            });
    }, []);

    const version = "HLT500_V306707"

    const Update = () => {
        const count = api.length / 2
        for (let i = 0; i < count; i++) {
            const b = i * 2
            const c = (i + 1) * 2
            const a = api.filter(e => {
                return e.id > b && e.id <= c
            })
            // console.log(a)
            const config = {
                id: a,
                version: version
            }
            // console.log(config)
            axios
                .put("http://localhost:3300/test/update", (config))
        }
    }
    // Update(api)

    return (
        <div>
            <Button label='Update' onClick={Update}></Button>
        </div>
    )
}

export default Test
